  `order_num` int(11) DEFAULT NULL COMMENT '排序',
  `replace_val` varchar(200) DEFAULT NULL COMMENT '取值表达式',
  `is_total` varchar(2) DEFAULT NULL COMMENT '是否合计 0否,1是（仅对数值有效）',
