-- ----------------------------
-- Table structure for tky_destfile
-- ----------------------------
DROP TABLE IF EXISTS `tky_destfile`;
CREATE TABLE `tky_destfile` (
  `id` varchar(32) NOT NULL,
  `url` varchar(200) DEFAULT NULL,
  `name` varchar(100) DEFAULT NULL,
  `bridge_detection_result_id` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `f6` (`bridge_detection_result_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='最终文件表';

-- ----------------------------
-- Records of tky_destfile
-- ----------------------------

-- ----------------------------
-- Table structure for tky_disease
-- ----------------------------
DROP TABLE IF EXISTS `tky_disease`;
CREATE TABLE `tky_disease` (
  `id` varchar(32) NOT NULL,
  `bridge_info_line_name` varchar(200) DEFAULT '' COMMENT '线名',
  `bridge_info_name` varchar(100) DEFAULT NULL COMMENT '桥梁名称',
  `bridge_info_code` varchar(100) DEFAULT NULL COMMENT '桥梁编号',
  `detection_time` varchar(20) DEFAULT NULL COMMENT '检测时间',
  `type` varchar(50) DEFAULT NULL COMMENT '病害类型',
  `type_value` varchar(50) DEFAULT NULL COMMENT '名称缩写',
  `direction` varchar(100) DEFAULT NULL COMMENT '形态',
  `line_mil` varchar(10) DEFAULT NULL COMMENT '线路里程',
  `area` varchar(500) DEFAULT NULL COMMENT '面积',
  `area_text` varchar(255) DEFAULT NULL,
  `position` varchar(255) DEFAULT NULL,
  `width_mean` double(12,1) DEFAULT NULL COMMENT '平均宽度',
  `length` double(12,2) DEFAULT NULL COMMENT '长度',
  `updown` varchar(50) DEFAULT NULL COMMENT '上下行',
  `region` varchar(50) DEFAULT NULL COMMENT '区域',
  `length_from_bottom` varchar(50) DEFAULT NULL COMMENT '距人行道板距离',
  `level` varchar(50) DEFAULT NULL COMMENT '等级',
  `type_code` varchar(100) DEFAULT NULL COMMENT '病害编码',
  `description` text COMMENT '描述信息',
  `img_url` varchar(1000) DEFAULT NULL,
  `img_name` varchar(1000) DEFAULT NULL COMMENT '对应图片文件名称',
  `crack_location` text COMMENT '病害相对位置',
  `url` varchar(1000) DEFAULT NULL COMMENT '地址',
  `disease_img_name` varchar(1000) DEFAULT NULL,
  `bridge_detection_result_id` varchar(32) DEFAULT NULL,
  `create_by` varchar(32) DEFAULT NULL COMMENT 'createBy',
  `create_time` datetime DEFAULT NULL COMMENT 'createTime',
  `update_by` varchar(32) DEFAULT NULL COMMENT 'updateBy',
  `update_time` datetime DEFAULT NULL COMMENT 'updateTime',
  `width_grade` varchar(10) DEFAULT NULL COMMENT '宽度等级',
  `intersection_angle` varchar(10) DEFAULT NULL COMMENT '与轨道方向夹角',
  `concern_extent` varchar(20) DEFAULT NULL COMMENT '关注程度',
  `level_code` varchar(10) DEFAULT NULL COMMENT '伤损等级代码',
  `component_name` varchar(20) DEFAULT NULL COMMENT '部件名称',
  `component_value` varchar(10) DEFAULT NULL COMMENT '部件编码',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `FK_Reference_5` (`bridge_detection_result_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='病害信息表';

